import React, { Component } from 'react';
import './App.css';
import Parks from './Park/Park';
import data from './np_from_WIKI.json'

class App extends Component {
  state = {
  }

  componentDidMount(){
    this.getParks();
    // this.setState({parks:data["table"]});
  }

  getParks = () => {
    fetch('http://localhost:4000/').then((res) => {
      return res.json();
    }).then((res) => {
      // console.log(res);
      this.setState({parks:res["table"]});
    })
    .catch((err) => {
      console.log(err);
    });
  }

  renderParks = ({e,i}) => {
    console.log(e)
    return <Parks name={e.name} url={"http://" + e.image} />
  }

  display = () => {
    alert("button");
  }
  render() {
    const parks = this.state
    return (
      <div className="App">
        <div className="wrapper">{
          (parks.parks != null) ? parks.parks.map(this.renderParks) : null
        }
          </div>
      </div>
    );
  }
}

export default App;
